import React from 'react';
import Playlist from './Playlist';
import './App.css'; // Import the external stylesheet

const App = () => {
  return (
    <div className="app-container">
      <h1 className="playlistTitle">Matt Gisin's Playlist</h1>
      <Playlist />
    </div>
  );
};

export default App;
